import React from "react";

const LobbyScreen = ()=> {

    const [email, setEmail] = use
    return (
        <div>
            <h1>Lobby</h1>
            <form>
                <label htmlFor="email">Email ID</label>
                <input type="email" id="email" />
                <label htmlFor="room">Room Number</label>
                <input type="text" id="room" />
                <br />
                <button>Join</button>
            </form>
        </div>
    );
};

export default LobbyScreen;
